INSERT INTO `tour` (`TOURID`, `TOURTYPEID`, `TOURNAME`, `DESCRIPTION`, `PRICE`, `TIME`, `IMAGE`) VALUES
(1, 1, 'Tour Sông Nước Cần Thơ', 'Dưới đây là một lịch trình mẫu cho một tour du lịch sông nước ở Cần Thơ, tập trung vào việc khám phá chợ nổi Cái Răng và các điểm tham quan ven sông:\\r\\n\\r\\n### **Lịch Trình Tour Sông Nước Cần Thơ**\\r\\n\\r\\n**5:00 AM - Khởi hành từ bến Ninh Kiều**\\r\\n- Khách được đón tại bến Ninh Kiều và bắt đầu hành trình trên sông Hậu.\\r\\n- Thuyền di chuyển dọc theo sông Hậu, du khách có thể ngắm bình minh trên sông và cảnh sinh hoạt buổi sáng của người dân ven sông.\\r\\n\\r\\n**6:00 AM - Tham quan Chợ Nổi Cái Răng**\\r\\n- Đến chợ nổi Cái Răng, một trong những chợ nổi lớn và nổi tiếng nhất ở miền Tây.\\r\\n- Du khách có thể mua sắm các loại trái cây, nông sản tươi ngon và thưởng thức bữa sáng trên thuyền với các món ăn đặc trưng như hủ tiếu, bún riêu, cà phê.\\r\\n\\r\\n**7:30 AM - Tham quan Lò Hủ Tiếu**\\r\\n- Tham quan một lò hủ tiếu truyền thống tại địa phương, tìm hiểu quy trình làm hủ tiếu, trải nghiệm tự tay làm hủ tiếu.\\r\\n- Có thể mua hủ tiếu tươi hoặc các sản phẩm làm từ hủ tiếu về làm quà.\\r\\n\\r\\n**8:30 AM - Tham quan Vườn Trái Cây**\\r\\n- Di chuyển đến vườn trái cây Phong Điền hoặc một khu vườn khác tại địa phương.\\r\\n- Tại đây, du khách có thể tham quan, hái và thưởng thức trái cây ngay tại vườn như chôm chôm, măng cụt, sầu riêng (tuỳ theo mùa vụ).\\r\\n\\r\\n**10:00 AM - Tham quan Nhà Cổ Bình Thủy**\\r\\n- Trở lại bờ và di chuyển đến Nhà Cổ Bình Thủy, một ngôi nhà cổ hơn 100 năm tuổi với kiến trúc độc đáo kết hợp giữa phong cách Á-Âu.\\r\\n- Tìm hiểu về lịch sử và kiến trúc của ngôi nhà, cũng như cuộc sống của những gia đình quyền quý xưa.\\r\\n\\r\\n**11:00 AM - Trở về bến Ninh Kiều**\\r\\n- Thuyền đưa du khách trở về bến Ninh Kiều.\\r\\n- Kết thúc tour, du khách tự do tham quan hoặc thưởng thức ẩm thực tại trung tâm thành phố Cần Thơ.\\r\\n\\r\\n### **Gợi Ý Thêm**\\r\\n- Nếu muốn, du khách có thể kéo dài thời gian tham quan để trải nghiệm thêm các hoạt động như thăm quan chợ đêm Ninh Kiều, tham gia tour đi thuyền thả đèn hoa đăng buổi tối.\\r\\n\\r\\nLịch trình này có thể được tùy chỉnh linh hoạt theo nhu cầu và sở thích của du khách, cũng như tùy thuộc vào thời gian khởi hành.', '1599000', '2', );
INSERT INTO `tour` (`TOURID`, `TOURTYPEID`, `TOURNAME`, `DESCRIPTION`, `PRICE`, `TIME`, `IMAGE`) VALUES
(2, 2, 'Tour Văn Hóa - Lịch Sử Cần Thơ', 'Dưới đây là một ví dụ về lịch trình tour văn hóa - lịch sử tại Cần Thơ. Lịch trình này có thể được điều chỉnh tùy theo sở thích và thời gian của bạn.\\r\\n\\r\\n### Lịch Trình Tour Văn Hóa - Lịch Sử Cần Thơ\\r\\n\\r\\n#### Ngày 1: Khám Phá Cần Thơ\\r\\n- **Sáng:**\\r\\n  - **Cảng Cần Thơ:** Bắt đầu chuyến tham quan tại cảng, nơi bạn có thể thưởng thức bữa sáng với các món ăn đặc trưng của miền Tây.\\r\\n  - **Chợ Nổi Cái Răng:** Đi thuyền tham quan chợ nổi nổi tiếng, nơi bạn có thể mua sắm các sản phẩm nông sản và đặc sản miền Tây. Đây là cơ hội để trải nghiệm cuộc sống của người dân địa phương và tìm hiểu về các sản phẩm nông sản độc đáo.\\r\\n- **Trưa:**\\r\\n  - **Bữa trưa tại nhà hàng địa phương:** Thưởng thức các món ăn đặc sản như cá kho tộ, bún riêu, bánh xèo.\\r\\n- **Chiều:**\\r\\n  - **Nhà cổ Bình Thủy:** Tham quan nhà cổ được xây dựng từ thế kỷ 19, nổi bật với kiến trúc cổ điển và các hiện vật lịch sử.\\r\\n  - **Vườn trái cây:** Ghé thăm một trong các vườn trái cây nổi tiếng của Cần Thơ để thưởng thức các loại trái cây nhiệt đới.\\r\\n- **Tối:**\\r\\n  - **Dạo phố Cần Thơ:** Tự do khám phá phố đêm, thưởng thức các món ăn đường phố và tham quan các khu vực như bến Ninh Kiều.\\r\\n\\r\\n#### Ngày 2: Khám Phá Lịch Sử và Văn Hóa\\r\\n- **Sáng:**\\r\\n  - **Bảo Tàng Cần Thơ:** Tham quan bảo tàng để tìm hiểu về lịch sử và văn hóa của vùng Đồng Bằng Sông Cửu Long.\\r\\n  - **Chùa Nam Nhã (Chùa Ông):** Tham quan chùa với kiến trúc đặc trưng của người Hoa và tìm hiểu về lịch sử của cộng đồng người Hoa tại Cần Thơ.\\r\\n- **Trưa:**\\r\\n  - **Bữa trưa tại nhà hàng địa phương:** Thưởng thức các món ăn đặc sản của vùng.\\r\\n- **Chiều:**\\r\\n  - **Khu di tích Lịch sử Giồng Dành:** Tham quan khu di tích để hiểu thêm về cuộc chiến tranh chống Pháp và lịch sử địa phương.\\r\\n  - **Khu du lịch sinh thái Mỹ Khánh:** Trải nghiệm không khí trong lành của khu du lịch sinh thái, tham gia vào các hoạt động như chèo thuyền, đạp xe, và thưởng thức các món ăn dân dã.\\r\\n- **Tối:**\\r\\n  - **Dịch vụ thư giãn:** Nghỉ ngơi tại khách sạn hoặc tham gia vào các hoạt động giải trí địa phương như ca nhạc dân ca, múa lân.\\r\\n\\r\\n#### Ngày 3: Khám Phá và Rời Cần Thơ\\r\\n- **Sáng:**\\r\\n  - **Chợ Cần Thơ:** Tham quan chợ Cần Thơ, mua sắm các món quà lưu niệm và đặc sản trước khi rời thành phố.\\r\\n  - **Dạo quanh bến Ninh Kiều:** Tận hưởng không khí buổi sáng tại bến Ninh Kiều, một trong những biểu tượng của Cần Thơ.\\r\\n- **Trưa:**\\r\\n  - **Bữa trưa tại nhà hàng:** Thưởng thức bữa trưa và chuẩn bị rời Cần Thơ.\\r\\n- **Chiều:**\\r\\n  - **Kết thúc tour:** Trả phòng khách sạn và di chuyển đến điểm đến tiếp theo hoặc về nhà.\\r\\n\\r\\n### Ghi Chú\\r\\n- Lịch trình có thể thay đổi tùy thuộc vào thời gian di chuyển và các điều kiện cụ thể.\\r\\n- Đảm bảo kiểm tra thời tiết và các sự kiện địa phương trước khi lên kế hoạch.\\r\\n- Có thể thêm hoặc điều chỉnh các điểm tham quan theo sở thích cá nhân.\\r\\n\\r\\nHy vọng bạn sẽ có một chuyến đi thú vị và đầy trải nghiệm tại Cần Thơ!', '1899000', '3', );
INSERT INTO `tour` (`TOURID`, `TOURTYPEID`, `TOURNAME`, `DESCRIPTION`, `PRICE`, `TIME`, `IMAGE`) VALUES
(3, 3, 'Tour Du Lịch Sinh Thái - Ẩm Thực Tại Cần Thơ', 'Dưới đây là một lịch trình gợi ý cho tour du lịch sinh thái-ẩm thực tại Cần Thơ:\\r\\n\\r\\n### Lịch Trình Tour Du Lịch Sinh Thái - Ẩm Thực Tại Cần Thơ\\r\\n\\r\\n#### **Ngày 1: Khám Phá Thành Phố Cần Thơ và Ẩm Thực Địa Phương**\\r\\n\\r\\n**Sáng:**\\r\\n- **08:00**: Đón khách tại điểm hẹn ở Cần Thơ.\\r\\n- **08:30**: Tham quan Chợ nổi Cái Răng – một trong những chợ nổi nổi tiếng nhất ở đồng bằng sông Cửu Long. Khách sẽ được trải nghiệm mua sắm trên sông và thưởng thức món ăn đặc sản như bánh xèo, hủ tiếu.\\r\\n\\r\\n**Trưa:**\\r\\n- **12:00**: Ăn trưa tại nhà hàng địa phương với các món ăn đặc sản như cá lóc nướng trui, bún nước lèo.\\r\\n\\r\\n**Chiều:**\\r\\n- **14:00**: Tham quan vườn trái cây Mỹ Khánh. Khách có thể đi dạo trong vườn, thưởng thức các loại trái cây tươi ngon theo mùa, và tìm hiểu về nông nghiệp sinh thái của địa phương.\\r\\n- **16:00**: Tham quan Bến Ninh Kiều – biểu tượng của thành phố Cần Thơ. Tận hưởng không khí trong lành và ngắm cảnh đẹp trên bến cảng.\\r\\n\\r\\n**Tối:**\\r\\n- **19:00**: Dùng bữa tối tại nhà hàng với các món ăn đặc sản như cơm tấm, bánh hỏi, và các món hải sản.\\r\\n- **20:30**: Tự do khám phá thành phố về đêm hoặc tham gia một tour đi bộ để khám phá các quán cà phê và cửa hàng địa phương.\\r\\n\\r\\n#### **Ngày 2: Khám Phá Sinh Thái và Ẩm Thực Tại Các Vùng Lân Cận**\\r\\n\\r\\n**Sáng:**\\r\\n- **07:00**: Ăn sáng với các món ăn truyền thống như bánh cuốn, xôi, và cà phê sữa đá.\\r\\n- **08:00**: Khởi hành đến Rừng Tràm Trà Sư – một khu rừng ngập nước đẹp như tranh vẽ. Khách sẽ đi thuyền trên các kênh rạch, chiêm ngưỡng cảnh quan thiên nhiên và động thực vật phong phú.\\r\\n\\r\\n**Trưa:**\\r\\n- **12:00**: Dùng bữa trưa tại một nhà hàng trong khu vực Rừng Tràm Trà Sư với các món ăn địa phương như lươn um, cá nướng.\\r\\n\\r\\n**Chiều:**\\r\\n- **14:00**: Trở lại Cần Thơ và tham quan Nhà cổ Bình Thủy – một ngôi nhà mang đậm dấu ấn của kiến trúc Pháp và Việt Nam.\\r\\n- **16:00**: Tham quan Trung tâm văn hóa Cần Thơ hoặc tự do mua sắm tại các chợ địa phương.\\r\\n\\r\\n**Tối:**\\r\\n- **19:00**: Dùng bữa tối tại nhà hàng địa phương, thưởng thức các món ăn truyền thống và đặc sản Cần Thơ.\\r\\n- **20:30**: Kết thúc tour, đưa khách về điểm đón hoặc tự do tham quan thành phố.\\r\\n\\r\\n### **Lưu Ý:**\\r\\n- **Chuẩn bị:** Mang theo quần áo thoải mái, mũ nón, kem chống nắng, và giày đi bộ.\\r\\n- **Đặt chỗ trước:** Để đảm bảo có chỗ tại các điểm tham quan và nhà hàng.\\r\\n- **Thay đổi lịch trình:** Có thể thay đổi tùy theo điều kiện thời tiết và yêu cầu của khách.\\r\\n\\r\\nHy vọng lịch trình này giúp bạn có một chuyến đi thú vị và tràn đầy trải nghiệm!', '2099000', '2', );
INSERT INTO `tour` (`TOURID`, `TOURTYPEID`, `TOURNAME`, `DESCRIPTION`, `PRICE`, `TIME`, `IMAGE`) VALUES
(4, 4, 'Tour Làng Nghề Tại Cần Thơ', 'Dưới đây là một ví dụ về lịch trình cho tour du lịch làng nghề tại Cần Thơ, được thiết kế để khám phá các làng nghề truyền thống và tìm hiểu văn hóa địa phương:\\r\\n\\r\\n### **Lịch Trình Tour Làng Nghề Tại Cần Thơ**\\r\\n\\r\\n**Ngày 1: Khám Phá Các Làng Nghề Truyền Thống**\\r\\n\\r\\n**Sáng:**\\r\\n1. **08:00 - 08:30**: Đón khách tại khách sạn và khởi hành đến làng nghề đầu tiên.\\r\\n2. **09:00 - 10:30**: Tham quan **Làng Nghề Gốm Bàu Sen** - Xem quy trình làm gốm truyền thống, từ tạo hình đến nung gốm.\\r\\n3. **10:30 - 11:00**: Tham quan **Làng Nghề Dệt Lụa Long Định** - Tìm hiểu quy trình dệt lụa và các sản phẩm lụa truyền thống của Cần Thơ.\\r\\n\\r\\n**Trưa:**\\r\\n4. **11:30 - 12:30**: Ăn trưa tại nhà hàng địa phương với các món ăn đặc sản của Cần Thơ.\\r\\n\\r\\n**Chiều:**\\r\\n5. **13:00 - 14:30**: Tham quan **Làng Nghề Chế Biến Thực Phẩm** - Xem các quy trình chế biến thực phẩm truyền thống như làm mắm, dưa, và các món ăn địa phương.\\r\\n6. **15:00 - 16:30**: Khám phá **Làng Nghề Chạm Khắc Gỗ** - Tìm hiểu về nghệ thuật chạm khắc gỗ và các sản phẩm gỗ truyền thống của địa phương.\\r\\n\\r\\n**Tối:**\\r\\n7. **18:00 - 19:00**: Quay về khách sạn, nghỉ ngơi.\\r\\n8. **19:30**: Ăn tối tại nhà hàng địa phương, thưởng thức các món ăn đặc sản của Cần Thơ.\\r\\n\\r\\n**Ngày 2: Khám Phá Thêm và Mua Sắm**\\r\\n\\r\\n**Sáng:**\\r\\n1. **08:00 - 09:30**: Tham quan **Làng Nghề Sản Xuất Nón Lá** - Tìm hiểu quy trình làm nón lá truyền thống và cách bảo quản nón.\\r\\n2. **10:00 - 11:30**: Khám phá **Làng Nghề Trồng Hoa và Cây Cảnh** - Xem các loại hoa và cây cảnh đặc sản của Cần Thơ.\\r\\n\\r\\n**Trưa:**\\r\\n3. **12:00 - 13:00**: Ăn trưa tại nhà hàng địa phương.\\r\\n\\r\\n**Chiều:**\\r\\n4. **13:30 - 15:00**: Tự do mua sắm và tham quan chợ địa phương để mua các sản phẩm đặc trưng của Cần Thơ.\\r\\n5. **15:30**: Khởi hành về lại khách sạn, kết thúc tour.\\r\\n\\r\\n**Tối:**\\r\\n6. **18:00**: Ăn tối tại khách sạn hoặc nhà hàng địa phương (tuỳ chọn).\\r\\n\\r\\n**Lưu ý:**\\r\\n- Lịch trình có thể thay đổi tùy thuộc vào thời tiết và sự sẵn có của các điểm tham quan.\\r\\n- Đảm bảo kiểm tra các giờ hoạt động và lịch làm việc của các làng nghề trước khi đi.\\r\\n- Các bữa ăn có thể được thay đổi theo yêu cầu và sở thích của khách.\\r\\n\\r\\nBạn có thể tùy chỉnh lịch trình này để phù hợp với nhu cầu và sở thích của nhóm khách hàng hoặc bổ sung các hoạt động khác nếu cần.', '500000', '2', );

